function findMin(arr) {
  if (arr.length === 1) {
    return arr[0];
  } else {
    let min = arr[0];
    for (let i = 1; i < arr.length; i++) {
      if (arr[i] < min) {
        min = arr[i];
      }
    }
    return min;
  }
}
